import './css/App.scss';
import Project from './Project'
import Header from './Header'
import About from './About'
// import Slideshow from './Slideshow'
// import 'react-slideshow-image/dist/styles.css'

function App() {

  const [MousePosition, setMousePosition] = useState({
    left: 50,
    top: 50,
  })

  function handleMouseMove(ev) { setMousePosition({left: ev.pageX, top: ev.pageY}); }

  return (
    <div className="app">
      <Header/>
      <div className="app__container" id="home">
        <div className="splash">
          <div className="bg"></div>
          <div className="title">
              <h1>Hello</h1>
              <p>I'm Tarun, an engineer & creator.</p>
          </div>
        </div>
        <Project/>
        <About/>
        <div className="footer">
          <div className="footer__top">
            <div className="footnote__container">
              <div className="footnote__items">
                <p>Contact me.</p>             
              </div>
            </div>
          </div>
          <p>Tarun Khasnavis Â© 2021</p>
        </div>
      </div>
    </div>
  );
}

export default App;
